// FUNCTION ///////////////////////////////////////////////////////////////////
function letter_to_amino_acid(letter) {
  if (typeof(letter) == 'undefined') { return; }
  if (letter.length > 1) { return; }
  letter = letter.toUpperCase();
  return aa_letters[letter];
} // end function
///////////////////////////////////////////////////////////////////////////////
// FUNCTION ///////////////////////////////////////////////////////////////////
function mrca_to_blosum(mya) {
  if (mya <= 200) { return BLOSUM80; }
  if (mya > 200 && mya <= 1000) { return BLOSUM62; }
  if (mya > 1000) { return BLOSUM45; }
} // end function
///////////////////////////////////////////////////////////////////////////////
// FUNCTION ///////////////////////////////////////////////////////////////////
function mrca_to_blosum_number(mya) {
  if (mya <= 200) { return 80; }
  if (mya > 200 && mya <= 1000) { return 62; }
  if (mya > 1000) { return 45; }
} // end function
